    .back {
        height: 100%;
        width: 100%;
        overflow: hidden;
        position: fixed;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
    }

.container {
        position: relative;
        max-width: 550px;
        margin: 0 auto;
    }

    a {
        color: inherit;
    }

    .error {
        margin-top: 5rem;
        font-size: 12rem;
        color: red;
        text-align: center;
    }

    /*---------------
            Header
        ---------------*/
    header .container {
        padding: 0 15rem 0;
    }

    .header__top {
        display: flex;
        align-items: center;
        justify-content: space-between;
    }

    .logo,
    .age {
        display: block;
    }

    .logo {
        height: 50rem;
    }

    .age {
        height: 35rem;
    }

    .header__title {
            margin: 0 2rem 15rem;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    }

    .header__title h1 {
        margin-top: 5rem;
        font-size: 18rem;
        font-weight: 700;
        line-height: 1;
